const GalleryImage = (props) => {
  const imageId = props.id;
  const imageSrc = props.img_src;
  const fullName = props.camera.full_name;
  const imageDate = props.earth_date;

  return (
    <div data-image-id={imageId}>
      <img
        className={`grid-item grid-item-${props.index}`}
        src={imageSrc}
        alt={`${fullName}-${imageDate}`}
      />
      <p>Camera: {fullName}</p>
      <p>Date: {imageDate}</p>
    </div>
  );
};

export default GalleryImage;
